/// <summary>
/// Performs specific actions when a form is closed.
/// </summary>
public void closeOK()
{
    InventSiteGateEntryLine_IN  inventSiteGateEntryLine;
    InventTransferLine   inventTransferLineLoc;
    Object InventSiteGateEntry_DataSource;
    RecordInsertList recordInsertList;

    super();

    if (inventSiteGateEntry)
    {
        delete_from inventSiteGateEntryLine
            where inventSiteGateEntryLine.InventSiteGateEntry == inventSiteGateEntry.RecId;

        if (inventSiteGateEntry.Type == InventSiteGateEntryType_IN::Inward)
        {
            recordInsertList = new RecordInsertList(tableNum(InventSiteGateEntryLine_IN));

            while select @tableNum, RecordNo, Id, LineNum, ItemId, InventDimId, Qty from tmpFrmVirtualLines
                join QtyShipped, QtyReceived, UnitId from inventTransferLineLoc where inventTransferLineLoc.RecId == tmpFrmVirtualLines.RecordNo
            {
                Qty challanQty = abs(inventTransferLineLoc.QtyShipped - inventTransferLineLoc.QtyReceived);

                inventSiteGateEntryLine.SourceTableId = tmpFrmVirtualLines.TableNum;
                inventSiteGateEntryLine.SourceRecId = tmpFrmVirtualLines.RecordNo;
                inventSiteGateEntryLine.OrderId = tmpFrmVirtualLines.Id;
                inventSiteGateEntryLine.LineNum = tmpFrmVirtualLines.LineNum;
                inventSiteGateEntryLine.ItemId = tmpFrmVirtualLines.ItemId;
                inventSiteGateEntryLine.InventDimId = tmpFrmVirtualLines.InventDimId;
                inventSiteGateEntryLine.OrderQty = tmpFrmVirtualLines.Qty;
                inventSiteGateEntryLine.ChallanQty = challanQty;
                inventSiteGateEntryLine.MeasuredQty = challanQty;
                inventSiteGateEntryLine.UnitOfMeasurement = inventTransferLineLoc.UnitId;
                inventSiteGateEntryLine.InventoryUnit = inventTransferLineLoc.UnitId;

                recordInsertList.add(inventSiteGateEntryLine);
            }

            recordInsertList.insertDatabase();
        }
        else
        {
            insert_recordset inventSiteGateEntryLine(
                SourceTableId,
                SourceRecId,
                OrderId,
                LineNum,
                ItemId,
                InventDimId,
                OrderQty,
                ChallanQty,
                MeasuredQty,
                UnitOfMeasurement,
                InventoryUnit)
            select @tableNum, RecordNo, Id, LineNum, ItemId, InventDimId, Qty from tmpFrmVirtualLines
                join QtyRemainShip, QtyRemainShip, UnitId, UnitId from inventTransferLineLoc where inventTransferLineLoc.RecId == tmpFrmVirtualLines.RecordNo;
        }

        update_recordSet inventSiteGateEntryLine
            setting
                InventSiteGateEntry = inventSiteGateEntry.RecId,
                EntryId = inventSiteGateEntry.EntryId,
                ChallanNumber = inventSiteGateEntry.ChallanNumber,
                ChallanDate = inventSiteGateEntry.ChallanDate
            join tmpFrmVirtualLines
                where inventSiteGateEntryLine.SourceTableId == tmpFrmVirtualLines.TableNum &&
                    inventSiteGateEntryLine.SourceRecId == tmpFrmVirtualLines.RecordNo &&
                    !inventSiteGateEntryLine.InventSiteGateEntry &&
                    !inventSiteGateEntryLine.EntryId;

        ttsBegin;

        while select forUpdate inventSiteGateEntryLine where inventSiteGateEntryLine.InventSiteGateEntry == inventSiteGateEntry.RecId
        {
            inventSiteGateEntryLine.Description = InventTable::find(inventSiteGateEntryLine.ItemId).itemName(InventDim::find(inventSiteGateEntryLine.InventDimId));
            inventSiteGateEntryLine.RetrunableGatePassNumber = inventSiteGateEntry.RetrunableGatePassNumber;
            inventSiteGateEntryLine.update();
        }

        ttsCommit;

        InventSiteGateEntry_DataSource = FormDataUtil::getFormDataSource(inventSiteGateEntry);

        InventSiteGateEntry_DataSource.reRead();
        InventSiteGateEntry_DataSource.reFresh();
        InventSiteGateEntry_DataSource.reReadReferenceDataSources();

        if (formDataSourceHasMethod(InventSiteGateEntry_DataSource, identifierStr(reReadLines)))
        {
            InventSiteGateEntry_DataSource.reReadLines();
        }
    }
}

/// <summary>
/// This method acts as edit method for the marked purchase order line.
/// </summary>
/// <param name="_set">
/// Boolean value to set the value.
/// </param>
/// <param name="_line">
/// Common record value to set.
/// </param>
/// <param name="_id">
/// Num value to set.
/// </param>
/// <param name="_lineNum">
/// LineNum value to set.
/// </param>
/// <param name="_qty">
/// Qty value to set.
/// </param>
/// <param name="_inventDimId">
/// InventDimId value to set.
/// </param>
/// <param name="_itemId">
/// ItemId value to set.
/// </param>
/// <param name="_copy">
/// NoYes value to set.
/// </param>
/// <returns>
/// NoYes enum value.
/// </returns>
NoYes editCopy(boolean  _set,
               Common   _line,
               Num  _id,
               LineNum _lineNum,
               Qty _qty,
               InventDimId _inventDimId,
               ItemId _itemId,
               NoYes _copy)
{
    NoYes  copy;
    element.findTmpFrmVirtual(tmpFrmVirtualLines, _line.TableId, _line.RecId);

    if (tmpFrmVirtualLines)
    {
        copy   = NoYes::Yes;
    }

    if (_set)
    {
        if (_copy)
        {
            element.writeTmpFrmVirtual(tmpFrmVirtualLines,
                                       _line.TableId,
                                       _line.RecId,
                                       _id,
                                       _lineNum,
                                       _qty,
                                       _inventDimId,
                                       _itemId
                                       );

            copy   = NoYes::Yes;
        }
        else
        {
            tmpFrmVirtualLines.delete();
            copy   = NoYes::No;
        }
    }

    return copy;
}

/// <summary>
/// Fill marked gate entry lines.
/// </summary>
public void fillMarkedGateEntryLines()
{
    InventSiteGateEntryLine_IN  inventSiteGateEntryLine;

    insert_recordset tmpFrmVirtualLines(
        @TableNum,
        RecordNo,
        Id,
        LineNum,
        Qty,
        InventDimId,
        ItemId)
    select SourceTableId, SourceRecId, OrderId, LineNum, OrderQty, InventDimId, ItemId from inventSiteGateEntryLine
        where inventSiteGateEntryLine.InventSiteGateEntry == element.args().record().RecId;
}

/// <summary>
/// Finds the <C>TmpFrmVirtual</C> record based on Table Id and Record Id.
/// </summary>
/// <param name="_tmpFrmVirtual">
/// A <C>TmpFrmVirtual</C> record.
/// </param>
/// <param name="_tableId">
/// Table Id of <c>PurchLine</c> record.
/// </param>
/// <param name="_recId">
/// Record Id of <c>PurchLine</c> record.
/// </param>
void findTmpFrmVirtual(TmpFrmVirtual _tmpFrmVirtual, TableId _tableId, RecId _recId)
{
    select _tmpFrmVirtual
        where _tmpFrmVirtual.TableNum   == _tableId &&
              _tmpFrmVirtual.RecordNo   == _recId;
}

/// <summary>
/// Performs specific actions when a form is initialized.
/// </summary>
/// <exception cref="Exception::Error">
/// Warehouse must be filled on gate entry.
/// </exception>
/// <exception cref="Exception::Error">
/// Reference party must be filled on gate entry.
/// </exception>
public void init()
{
    inventSiteGateEntry = element.args().record();
    super();

    element.updateDesign(InventDimFormDesignUpdate::Init);

    if (!inventSiteGateEntry.InventLocationId)
    {
        throw error(strFmt("@SYP4860302"));
    }
    else if (!inventSiteGateEntry.ReferencePartyId)
    {
        throw error(strFmt("@SYP4860303"));
    }

    this.fillMarkedGateEntryLines();
}

