/// <summary>
/// Performs specific actions when a <c>InventTransferLine</c> datasource is executed.
/// </summary>
public void executeQuery()
{
    if (inventSiteGateEntry.Type == InventSiteGateEntryType_IN::Inward)
    {
        qbrRemainStatus.value(strfmt('((%1 == %2) || (%3-%4 > %5))', fieldstr(InventTransferLine, RemainStatus), SysQuery::value(enum2int(InventTransferRemainStatus::Receiving)), fieldstr(InventTransferLine, QtyShipped),fieldstr(InventTransferLine, QtyReceived), 0));
    }
    else
    {
        qbrRemainStatus.value(SysQuery::value(InventTransferRemainStatus::Shipping));
    }
     super();
}

