/// <summary>
/// Performs specific actions when a <c>InventTransferTable</c> datasource is initialized.
/// </summary>
public void init()
{
    super();

    if (inventSiteGateEntry.Type == InventSiteGateEntryType_IN::Inward)
    {
        qbrToWarehouse = this.query().dataSourceTable(tableNum(InventTransferTable)).addRange(fieldNum(InventTransferTable, InventLocationIdTo));
        qbrToWarehouse.value(SysQuery::value(InventSiteGateEntry.InventLocationId));
        qbrToWarehouse.status(RangeStatus::Hidden);
        qbrFromWarehouse = this.query().dataSourceTable(tableNum(InventTransferTable)).addRange(fieldNum(InventTransferTable, InventLocationIdFrom));
        qbrFromWarehouse.value(SysQuery::value(inventSiteGateEntry.ReferencePartyId));
        qbrFromWarehouse.status(RangeStatus::Hidden);
    }
    else
    {
        qbrToWarehouse = this.query().dataSourceTable(tableNum(InventTransferTable)).addRange(fieldNum(InventTransferTable, InventLocationIdTo));
        qbrToWarehouse.value(SysQuery::value(inventSiteGateEntry.ReferencePartyId));
        qbrToWarehouse.status(RangeStatus::Hidden);
        qbrFromWarehouse = this.query().dataSourceTable(tableNum(InventTransferTable)).addRange(fieldNum(InventTransferTable, InventLocationIdFrom));
        qbrFromWarehouse.value(SysQuery::value(InventSiteGateEntry.InventLocationId));
        qbrFromWarehouse.status(RangeStatus::Hidden);
    }
}

